import React from 'react'
import {Navbar, Nav} from 'react-bootstrap';
import {InputGroup,FormControl} from 'react-bootstrap';
import {Button} from 'react-bootstrap'
import  '../assets/css/navbarstyle.css';



// import { InputGroupPrepend } from 'react-bootstrap/InputGroup';

export default class HomeNavbar extends React.Component{
    render(){
        return(
            <div className="homeNav">
               <Navbar bg="dark">
                   <Navbar.Brand>NeoSTORE</Navbar.Brand>
                   <Nav className="mr-auto">
                        <Nav.Link href="#home">HOME</Nav.Link>
                        <Nav.Link href="#product">PRODUCT</Nav.Link>
                        <Nav.Link href="#order">ORDER</Nav.Link>
                        <InputGroup className="mb-3" inline>
                            <InputGroup.Prepend className="searchIcon">

                            <InputGroup.Text id="basic-addon1">@<i class="fas fa-search" /></InputGroup.Text>
                            </InputGroup.Prepend>
                            <FormControl

                            placeholder="Search.."
                            aria-label="Username"
                            aria-describedby="basic-addon1"
                            />
                        </InputGroup>
                        <Button className="cartButton" variant="Link">Cart</Button>
                   </Nav>
               </Navbar>
            </div>
        );
    }
}
